import React, { useState, useEffect } from 'react';


const TimerSection = () => {
    const [timeLeft, setTimeLeft] = useState({
        days: 6,
        hours: 6,
        minutes: 6,
        seconds: 6
    });

    useEffect(() => {
        // Set end date (7 days from now for demo)
        const endDate = new Date();
        endDate.setDate(endDate.getDate() + 7);

        const timer = setInterval(() => {
            const now = new Date();
            const difference = endDate.getTime() - now.getTime();

            if (difference > 0) {
                setTimeLeft({
                    days: Math.floor(difference / (1000 * 60 * 60 * 24)),
                    hours: Math.floor((difference % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)),
                    minutes: Math.floor((difference % (1000 * 60 * 60)) / (1000 * 60)),
                    seconds: Math.floor((difference % (1000 * 60)) / 1000)
                });
            } else {
                setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });
                clearInterval(timer);
            }
        }, 1000);

        return () => clearInterval(timer);
    }, []);

    const formatNumber = (num) => {
        return num.toString().padStart(2, '0');
    };

    return (
        <section
            className="py-16 text-white relative overflow-hidden"
            style={{
                backgroundImage: 'url("/images/banners/timer-background.png")',
                backgroundSize: 'cover',
                backgroundPosition: 'center'
            }}
        >
            {/* Background Overlay */}
            <div className="absolute inset-0 bg-gradient-to-r from-primary-400/80 to-dark-900/80"></div>

            <div className="container-custom relative z-10">
                <div className="max-w-4xl mx-auto text-center">
                    {/* Header */}
                    <h2 className="text-3xl md:text-4xl font-bold mb-8">
                        Enjoy A 50% Discount On Our Latest Collection
                    </h2>

                    {/* Timer Display */}
                    <div className="flex justify-center items-center gap-4 mb-8">
                        {/* Days */}
                        <div className="text-center">
                            <div className="bg-white/20 backdrop-blur-sm rounded-lg p-4 min-w-[80px]">
                                <div className="text-4xl md:text-5xl font-bold mb-1">
                                    {formatNumber(timeLeft.days)}
                                </div>
                                <div className="text-sm uppercase tracking-wider">
                                    Days
                                </div>
                            </div>
                        </div>

                        {/* Separator */}
                        <div className="text-4xl font-bold">:</div>

                        {/* Hours */}
                        <div className="text-center">
                            <div className="bg-white/20 backdrop-blur-sm rounded-lg p-4 min-w-[80px]">
                                <div className="text-4xl md:text-5xl font-bold mb-1">
                                    {formatNumber(timeLeft.hours)}
                                </div>
                                <div className="text-sm uppercase tracking-wider">
                                    Hours
                                </div>
                            </div>
                        </div>

                        {/* Separator */}
                        <div className="text-4xl font-bold">:</div>

                        {/* Minutes */}
                        <div className="text-center">
                            <div className="bg-white/20 backdrop-blur-sm rounded-lg p-4 min-w-[80px]">
                                <div className="text-4xl md:text-5xl font-bold mb-1">
                                    {formatNumber(timeLeft.minutes)}
                                </div>
                                <div className="text-sm uppercase tracking-wider">
                                    Minutes
                                </div>
                            </div>
                        </div>

                        {/* Separator */}
                        <div className="text-4xl font-bold">:</div>

                        {/* Seconds */}
                        <div className="text-center">
                            <div className="bg-white/20 backdrop-blur-sm rounded-lg p-4 min-w-[80px]">
                                <div className="text-4xl md:text-5xl font-bold mb-1 text-primary-400">
                                    {formatNumber(timeLeft.seconds)}
                                </div>
                                <div className="text-sm uppercase tracking-wider">
                                    Seconds
                                </div>
                            </div>
                        </div>
                    </div>

                    {/* CTA Button */}
                    <button className="bg-primary-400 text-white px-8 py-3 rounded-full font-semibold text-lg hover:bg-primary-500 transition-colors duration-300 shadow-lg">
                        Explore Products
                    </button>

                    {/* Additional Info */}
                    <p className="mt-6 text-white/80">
                        Limited time offer! Don't miss out on our premium collection.
                    </p>
                </div>
            </div>

            {/* Decorative Elements */}
            <div className="absolute top-10 left-10 w-20 h-20 bg-white/10 rounded-full animate-pulse"></div>
            <div className="absolute bottom-10 right-10 w-16 h-16 bg-primary-400/20 rounded-full animate-bounce"></div>
            <div className="absolute top-1/2 left-5 w-8 h-8 bg-white/5 rounded-full"></div>
        </section>
    );
};

export default TimerSection;
